関東～関西は送料無料です。<BR>
東北、中国、四国は+140円。<BR>
九州は+250円。北海道は+550円。<BR>
沖縄県は+3150円となります。<BR>
<BR>
西川産業(東京西川)製のおひるねふとんです。<BR>
カバーリングタイプなので、カバーでガラが隠れません。<BR>
不織布製の手提げバッグが付属します。<BR>
<BR>
＜セット内容＞<BR>
1.掛けふとんカバー　83cm×113cm　綿100％<BR>
　（ヨコひもタイプ）<BR>
2.掛けふとん（中芯）　79cm×109cm<BR>
　　　　　　　ふとんがわ：ポリエステル100％<BR>　　　　　　　　詰め物：ポリエステル100％<BR>
　　　　　　　詰めもの重量：350g<BR>
3.敷きふとんカバー　77cm×128cm　綿100％<BR>
　（ヨコひもタイプ）<BR>
4.敷きふとん（中芯）70cm×120cm<BR>
　　　　　　　ふとんがわ：ポリエステル100％<BR>　　　　　　　　詰め物：ポリエステル100％<BR>
　　　　　　　詰めもの重量：800g<BR>
5.まくら　　　20cm×28cm　パイル綿100％<BR>
6.手さげバッグ　 75cm×45cm　ポリエステル100％<br>　　　　　　　　不織布製です。<BR>
中国製<br>
<BR>
※ビニールの外袋は配送時の衝撃などで、まれに<BR>
　ほころびる場合がございますが不良ではありま<BR>
　せん。通常、トートバッグに入れ替えた後に廃棄<BR>
　するものなのでご了承ください。<BR>
<BR>

【あす楽対応_関東】<BR>
