         <TR>
          <TD bgcolor="#e7e7e7" align="center"><FONT color="#666666" size="-1"><strong>商品詳細</strong></FONT></TD>
          <TD bgcolor="#fefff0"><p style="color:#666; font-size:12px;"><b>外食時も清潔で安心！<br>使い捨てのお食事マットシート 20枚入り</b><br>
         テーブルに落ちたものを拾って食べちゃうベビーちゃんも、これなら清潔だから安心。<br>テーブルなどに付着している汚れやバイキンから守ってくれるお食事シート。
         裏面にあるテープを剥がしてテーブルにしっかり貼れてずれないので安心♪<br><br>

         カラフルで可愛いイラストで、ご飯を待っているときも夢中で遊んでくれたり…♪また、汚してはいけないお友達のお家でも使えそう！<br><br>
         使い終わったらそのまま畳んでゴミ箱へ！テーブルも汚さず衛星的！<br><br>

         旅行や帰省など、いつもと違い慣れない場所でも安心して食事ができます。
         <br><br>
          製品＆パッケージは9ヶ月～5年で土に還るエコ素材を使用しています。<br>
          また、ジップ付の袋入りだから持ち歩きに最適です♪

          </TD>
